import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <nav class="navbar ftco-navbar-light">
    <div class="container-xl">
      <a class="navbar-brand align-items-center" href="/"><span class="">Suzdalenko</span></a>
   
      <button class="navbar-toggler collapsed" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" id="hamburgerButton" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
        <span class=""></span>
      </button>

      <div class="collapse navbar-collapse" id="navbarSupportedContent">
        <ul class="navbar-nav ms-auto mb-2 mb-lg-0" id="navUlLink">
          <li class="nav-item"><a class="nav-link active" href="/">Inicio</a></li>
      
          <li class="nav-item"><a class="nav-link" href="/Blog">Blog</a></li> 
      
        </ul>
      </div>
    </div>
  
  </nav>
  );
};

export default Navbar;

